import React from "react";
import { Box, Container, Grid } from "@mui/material";

export const Logo = ({ logo }) => {
  return (
    <Box
      component={"div"}
      display={"flex"}
      alignItems={"center"}
      alignContent={"center"}
      flexDirection={"column"}
      sx={{ mt: 2, mb: 4 }}
    >
      <img src={logo} height={"auto"} width={"50%"} alt="logoUdeA" />
    </Box>
  );
};
